import React, { Component } from 'react';
import './App.css';
import GoogleMap from './components/GoogleMap';
import Item from './components/Item'

class App extends Component {
  render() {
    return (
      <div className="App">
        <GoogleMap />
        <Item name="Antones Records"/>
        <Item name="Waterloo Records"/>
        <Item name="Austin Film Society"/>
      </div>
    );
  }
}

export default App;
